import React from 'react';

const Dashboard = () => {
    return (
        <div>
            <h1>Welcome to the Coach's Dashboard</h1>
            <p>This is your dashboard where you can manage athletes, schedule sessions, and review progress.</p>
            <p>Explore the tools available for managing your coaching responsibilities.</p>
        </div>
    );
};

export default Dashboard;
